import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import Card from "@material-ui/core/Card";
import CardHeader from "@material-ui/core/CardHeader";
import ForumIcon from "@material-ui/icons/Forum";
import CardContent from "@material-ui/core/CardContent";
import CardActions from "@material-ui/core/CardActions";
import Avatar from "@material-ui/core/Avatar";
import IconButton from "@material-ui/core/IconButton";
import Typography from "@material-ui/core/Typography";
import ShareIcon from "@material-ui/icons/Share";
import VisibilityOutlinedIcon from "@material-ui/icons/VisibilityOutlined";
// import KeyboardArrowRightIcon from "@material-ui/icons/KeyboardArrowRight";

import Card7 from "../images/card7.jfif";
import Card8 from "../images/card8.jfif";
import Card9 from "../images/card9.jfif";
import Card10 from "../images/card10.jfif";
import Card11 from "../images/card11.jfif";
import Card12 from "../images/card12.jfif";

import ChatBubbleRoundedIcon from "@material-ui/icons/ChatBubbleRounded";
import Profile1 from "../images/profile1.jfif";
import Profile2 from "../images/profile2.jfif";
import Profile3 from "../images/profile3.jfif";
import Profile4 from "../images/profile4.jfif";
import Profile5 from "../images/profile5.jfif";
import Profile6 from "../images/profile6.jfif";
import "../Components/fonts.css";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    marginTop: "2rem",
    borderRadius: "22px",
    width: "368px",
    marginLeft: "8.9rem",
    justifyContent:"space-evenly",
    boxShadow: "0px 4px 13px rgba(159, 153, 255, 0.11)",
    "&:hover": {
			boxShadow: "4px 20px 32px rgba(158, 175, 201, 0.5)"
		}
  },
  root1:{
    flexGrow: 1,
    marginTop: "2rem",
    borderRadius: "22px",
    width: "368px",
    marginLeft: "3.8rem",
    justifyContent:"space-evenly",
    boxShadow: "0px 4px 13px rgba(159, 153, 255, 0.11)",
    "&:hover": {
			boxShadow: "4px 20px 32px rgba(158, 175, 201, 0.5)"
		}
  },
  root2:{
    flexGrow: 1,
    marginTop: "2rem",
    borderRadius: "22px",
    width: "368px",
    marginLeft: "3.5rem",
    justifyContent:"space-evenly",
    boxShadow: "0px 4px 13px rgba(159, 153, 255, 0.11)",
    "&:hover": {
			boxShadow: "4px 20px 32px rgba(158, 175, 201, 0.5)"
		}
  },
  root3:{
    flexGrow: 1,
    marginTop: "2rem",
    borderRadius: "22px",
    width: "368px",
    marginLeft: "8.1rem",
    justifyContent:"space-evenly",
    boxShadow: "0px 4px 13px rgba(159, 153, 255, 0.11)",
    "&:hover": {
			boxShadow: "4px 20px 32px rgba(158, 175, 201, 0.5)"
		}
  },
  root4:{
    flexGrow: 1,
    marginTop: "2rem",
    borderRadius: "22px",
    width: "368px",
    marginLeft: "3.8rem",
    justifyContent:"space-evenly",
    boxShadow: "0px 4px 13px rgba(159, 153, 255, 0.11)",
    "&:hover": {
			boxShadow: "4px 20px 32px rgba(158, 175, 201, 0.5)"
		}
  },
  root5:{
    flexGrow: 1,
    marginTop: "2rem",
    borderRadius: "22px",
    width: "368px",
    marginLeft: "4.1rem",
    justifyContent:"space-evenly",
    boxShadow: "0px 4px 13px rgba(159, 153, 255, 0.11)",
    "&:hover": {
			boxShadow: "4px 20px 32px rgba(158, 175, 201, 0.5)"
		}
  },
  media: {
    height: 0,
    paddingTop: "56.25%", // 16:9
  },
  Readmore: {
    color: " rgba(55, 43, 255, 1)",
    cursor: "pointer",
    fontFamily: "Gotham-bold",
    fontSize: "12px",
    marginLeft:"0.4rem",
  },
  avatar: {
    width: "3rem",
    height: "3rem",
    borderRadius: "50%",
    top: -51,
    fontFamily: "Calibri",
    fontSize: "24px",
  },
}));

export default function CenteredGrid() {
  const classes = useStyles();

  return (
    <div>
      {/* Grid 1 Card */}
      <Grid container>
        <Grid>
          <Card className={classes.root}>
            <img
              src={Card9}
              alt="Card9"
              style={{
                width: "452px",
                height: "15.8rem",
              }}
            ></img>
            <CardHeader className={classes.header_title_card}
              avatar={
                <Avatar aria-label="recipe" className={classes.avatar}>
                  <img
                    src={Profile1}
                    alt={Profile1}
                    style={{ width: "45px" }}
                  ></img>
                </Avatar>
              }
              title="Reaching out to  new possibilities"
              subheader="John Doe"
            />
            <CardContent>
              <Typography variant="body2" color="textSecondary" component="p" style={{fontFamily:"Gotham-bold"}}>
                This impressive paella is a perfect party dish and a fun meal to
                cook together with your guests. Add 1 cup of frozen peas along
                with the mussels, if you like.
              </Typography>
            </CardContent>
            <CardActions disableSpacing>
              <h4 className={classes.Readmore}>
                Read More
              </h4>
              <IconButton
                aria-label="add to favorites"
                style={{ marginLeft: "5.2rem" }}
              >
                <VisibilityOutlinedIcon
                  style={{ fontSize: "21px", color: "#BABABA" }}
                />
              </IconButton>
              <IconButton aria-label="add to favorites">
                <ForumIcon style={{ fontSize: "21px", color: "#BABABA" }} />
              </IconButton>
              <IconButton aria-label="add to favorites">
                <ChatBubbleRoundedIcon
                  style={{ fontSize: "21px", color: "#BABABA" }}
                />
              </IconButton>
              <IconButton aria-label="share">
                <ShareIcon style={{ fontSize: "21px", color: "#BABABA" }} />
              </IconButton>
            </CardActions>
          </Card>
        </Grid>
        <Grid>
          <Card className={classes.root1}>
            <img
              src={Card8}
              alt="Card8"
              style={{
                width: "452px",
                height: "15.8rem",
              }}
            ></img>
            <CardHeader
              avatar={
                <Avatar aria-label="recipe" className={classes.avatar}>
                  <img
                    src={Profile2}
                    alt={Profile2}
                    style={{ width: "45px" }}
                  ></img>
                </Avatar>
              }
              action={<IconButton aria-label="settings"></IconButton>}
              title="Shrimp and Chorizo Paella"
              subheader="John Doe"
            />
            <CardContent>
              <Typography variant="body2" color="textSecondary" component="p" style={{fontFamily:"Gotham-bold"}}>
                This impressive paella is a perfect party dish and a fun meal to
                cook together with your guests. Add 1 cup of frozen peas along
                with the mussels, if you like.
              </Typography>
            </CardContent>
            <CardActions disableSpacing>
              <h4 className={classes.Readmore}>Read More</h4>
              <IconButton
                aria-label="add to favorites"
                style={{ marginLeft: "6.1rem" }}
              >
                <VisibilityOutlinedIcon
                  style={{ fontSize: "21px", color: "#BABABA" }}
